// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.8.7;

/// @title EthereumDIDRegistry Contract in alignment with the EIP-1056 specification
/// @author bloXmove
contract EthereumDIDRegistry {

  mapping(address => address) public owners;
  mapping(address => mapping(bytes32 => mapping(address => uint))) public delegates;
  mapping(address => uint) public changed;
  mapping(address => uint) public nonce;

  modifier onlyOwner(address identity, address actor) {
    require (actor == identityOwner(identity));
    _;
  }

  event DIDOwnerChanged(
    address indexed identity,
    address owner,
    uint previousChange
  );

  event DIDDelegateChanged(
    address indexed identity,
    bytes32 delegateType,
    address delegate,
    uint validTo,
    uint previousChange
  );

  event DIDAttributeChanged(
    address indexed identity,
    bytes32 name,
    bytes value,
    uint validTo,
    uint previousChange
  );

  /// @param identity address - owner of the identity
  /// @return address - of the identity
  function identityOwner(address identity) public view returns(address) {
     address owner = owners[identity];
     if (owner != address(0)) {
       return owner;
     }
     return identity;
  }

  /// @param identity address - to check the signature against
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param hash bytes32 - 
  /// @return address - signer of the signature
  function checkSignature(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 hash) internal returns(address) {
    address signer = ecrecover(hash, sigV, sigR, sigS);
    require(signer == identityOwner(identity));
    nonce[signer]++;
    return signer;
  }

  /// @param identity address - of the identity owning the delegate
  /// @param delegateType bytes32 - representation of the delegate type to be checked 
  /// @param delegate address - of the delegate to be checked
  /// @return bool - if delegate is expired or still valid
  function validDelegate(address identity, bytes32 delegateType, address delegate) public view returns(bool) {
    uint validity = delegates[identity][keccak256(abi.encodePacked(delegateType))][delegate];
    return (validity > block.timestamp);
  }

  /// @param identity address - of the identity of which the owner is going to be changed
  /// @param actor address - of the entity calling this function
  /// @param newOwner address - of the new owner of the identity
  function changeOwner(address identity, address actor, address newOwner) internal onlyOwner(identity, actor) {
    owners[identity] = newOwner;
    emit DIDOwnerChanged(identity, newOwner, changed[identity]);
    changed[identity] = block.number;
  }

  /// @param identity address - of the identity of which the owner is going to be changed
  /// @param newOwner address - of the new owner of the identity
  function changeOwner(address identity, address newOwner) public {
    changeOwner(identity, msg.sender, newOwner);
  }

  /// @param identity address - of the identity of which the owner is going to be changed
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param newOwner address - of the new owner of the identity
  function changeOwnerSigned(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, address newOwner) public {
    bytes32 hash = keccak256(abi.encodePacked(bytes1(0x19), bytes1(0), this, nonce[identityOwner(identity)], identity, "changeOwner", newOwner));
    changeOwner(identity, checkSignature(identity, sigV, sigR, sigS, hash), newOwner);
  }

  /// @param identity address - of the identity receiving the delegate
  /// @param actor address - of the entity calling this function
  /// @param delegateType bytes32 - representation of the delegate type to be set
  /// @param delegate address - of the delegate to be set
  /// @param validity uint - value defining the expiration date of the delegate
  function addDelegate(address identity, address actor, bytes32 delegateType, address delegate, uint validity) internal onlyOwner(identity, actor) {
    delegates[identity][keccak256(abi.encodePacked(delegateType))][delegate] = block.number + validity;
    emit DIDDelegateChanged(identity, delegateType, delegate, block.timestamp + validity, changed[identity]);
    changed[identity] = block.number;
  }

  /// @param identity address - of the identity receiving the delegate
  /// @param delegateType bytes32 - representation of the delegate type to be set
  /// @param delegate address - of the delegate to be set
  /// @param validity uint - value defining the expiration date of the delegate
  function addDelegate(address identity, bytes32 delegateType, address delegate, uint validity) public {
    addDelegate(identity, msg.sender, delegateType, delegate, validity);
  }

  /// @param identity address - of the identity receiving the signed delegate
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param delegateType bytes32 - representation of the delegate type to be set
  /// @param delegate address - of the delegate to be set
  /// @param validity uint - value defining the expiration date of the delegate
  function addDelegateSigned(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 delegateType, address delegate, uint validity) public {
    bytes32 hash = keccak256(abi.encodePacked(bytes1(0x19), bytes1(0), this, nonce[identityOwner(identity)], identity, "addDelegate", delegateType, delegate, validity));
    addDelegate(identity, checkSignature(identity, sigV, sigR, sigS, hash), delegateType, delegate, validity);
  }

  /// @param identity address - of the identity having the delegate revoked
  /// @param actor address - of the entity calling this function
  /// @param delegateType bytes32 - representation of the delegate type to be revoked
  /// @param delegate address - of the delegate to be revoked
  function revokeDelegate(address identity, address actor, bytes32 delegateType, address delegate) internal onlyOwner(identity, actor) {
    delegates[identity][keccak256(abi.encodePacked(delegateType))][delegate] = block.timestamp;
    emit DIDDelegateChanged(identity, delegateType, delegate, block.timestamp, changed[identity]);
    changed[identity] = block.number;
  }

  /// @param identity address - of the identity having the delegate revoked
  /// @param delegateType bytes32 - representation of the delegate type to be revoked
  /// @param delegate address - of the delegate to be revoked
  function revokeDelegate(address identity, bytes32 delegateType, address delegate) public {
    revokeDelegate(identity, msg.sender, delegateType, delegate);
  }

  /// @param identity address - of the identity having the delegate revoked
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param delegateType bytes32 - representation of the delegate type to be revoked
  /// @param delegate address - of the delegate to be revoked
  function revokeDelegateSigned(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 delegateType, address delegate) public {
    bytes32 hash = keccak256(abi.encodePacked(bytes1(0x19), bytes1(0), this, nonce[identityOwner(identity)], identity, "revokeDelegate", delegateType, delegate));
    revokeDelegate(identity, checkSignature(identity, sigV, sigR, sigS, hash), delegateType, delegate);
  }

  /// @param identity address - of the entity that will receive the attribute
  /// @param actor address - of the entity calling this function
  /// @param name bytes32 - name of the attribute be added
  /// @param value bytes calldata - containing the attributes values
  /// @param validity bytes32 - value defining the expiration date of the delegate
  function setAttribute(address identity, address actor, bytes32 name, bytes calldata value, uint validity ) internal onlyOwner(identity, actor) {
    emit DIDAttributeChanged(identity, name, value, block.timestamp + validity, changed[identity]);
    changed[identity] = block.number;
  }

  /// @param identity address - of the entity that will receive the attribute
  /// @param name bytes32 - name of the attribute be added
  /// @param value bytes calldata - containing the attributes values
  /// @param validity bytes32 - value defining the expiration date of the delegate
  function setAttribute(address identity, bytes32 name, bytes calldata value, uint validity) public {
    setAttribute(identity, msg.sender, name, value, validity);
  }

  /// @param identity address - of the entity that will receive the signed attribute
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param name bytes32 - name of the attribute to be added
  /// @param value bytes calldata - containing the attributes values
  /// @param validity bytes32 - value defining the expiration date of the delegate
  function setAttributeSigned(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 name, bytes calldata value, uint validity) public {
    bytes32 hash = keccak256(abi.encodePacked(bytes1(0x19), bytes1(0), this, nonce[identityOwner(identity)], identity, "setAttribute", name, value, validity));
    setAttribute(identity, checkSignature(identity, sigV, sigR, sigS, hash), name, value, validity);
  }

  /// @param identity address - of the entity that will have the attribute revoked
  /// @param actor address - of the entity calling this function
  /// @param name bytes32 - name of the attribute to be revoked
  /// @param value bytes calldata - containing the attributes values that will be revoked
  function revokeAttribute(address identity, address actor, bytes32 name, bytes calldata value) internal onlyOwner(identity, actor) {
    emit DIDAttributeChanged(identity, name, value, 0, changed[identity]);
    changed[identity] = block.number;
  }

  /// @param identity address - of the entity that will have the attribute revoked
  /// @param name bytes32 - name of the attribute to be revoked
  /// @param value bytes calldata - containing the attributes values that will be revoked
  function revokeAttribute(address identity, bytes32 name, bytes calldata value) public {
    revokeAttribute(identity, msg.sender, name, value);
  }

  /// @param identity address - of the entity that will have the signed attribute revoked
  /// @param sigV uint8 - recovery id of the signature
  /// @param sigR bytes32 - output of a ECDSA signature
  /// @param sigS bytes32 - output of a ECDSA signature
  /// @param name bytes32 - name of the attribute to be revoked
  /// @param value bytes calldata - containing the attributes values that will be revoked
 function revokeAttributeSigned(address identity, uint8 sigV, bytes32 sigR, bytes32 sigS, bytes32 name, bytes calldata value) public {
    bytes32 hash = keccak256(abi.encodePacked(bytes1(0x19), bytes1(0), this, nonce[identityOwner(identity)], identity, "revokeAttribute", name, value));
    revokeAttribute(identity, checkSignature(identity, sigV, sigR, sigS, hash), name, value);
  }

}

